import React from 'react';
import './App.css';
import Navbar from './components/navbar';
import Button from './components/button';
import Hero from './components/hero'
import {BrowserRouter as Router, Routes, Route} from 'react-router-dom';


function App() {
  return (
    <>
    <Router>
      <Navbar />
        <Routes>
          <Route path='/' exact />
        </Routes>
        <Button />
     </Router>
     {/* <Hero/> */}
    </>
  );
}

export default App;
